actions.click:
const scrollElement = event.currentTarget.parentElement.getElementsByClassName('product-scroll-container')[0];
const width = scrollElement.clientWidth;
if (scrollElement) {
    scrollElement.scrollLeft -= width;
}

const scrollElement = event.currentTarget.parentElement.getElementsByClassName('product-scroll-container')[0];
const width = scrollElement.clientWidth;
if (scrollElement) {
    scrollElement.scrollLeft += width;
}
